import React,{useState} from 'react'
import './Company.css'

function Company({name,value}) {
  let profit = true;
  if (value<0){
    profit = false;
  }

  return (
    <div className='box'>
    <div className='left'></div>
    <div className='right'>
        <span className='name'>{name} </span>
        <span className="value" style={{color:profit?"lightgreen":"red"}}>{value}%</span>
    </div>

    </div>
  )
}

export default Company
